import React from "react";
import DarkMode from "../DarkMode";
const Aside = () => {
  return (
    <nav>
      <ul>
        <li>dwad</li>
        <li>dawd</li>
        <li>
          <DarkMode />
        </li>
      </ul>
    </nav>
  );
};

export default Aside;
